            </div>

            {{ form_end(searchForm) }}

        </div>
    </div>
    {% block resultat %}
    {% endblock %}

{% endblock %}", "search/stock.html.twig", "C:\\wamp64\\www\\bookcatalogue\\templates\\search\\stock.html.twig");
